                                <p class=""mb-0 text-white-50"">
                                    You know what am I proud of? People may be proud of their achievements, properties, knowledge and other tangible things. Yeah, life has been easier with these goods but does that really count? Do these things make you happier every time you catch a sight on? If so, then I must say you haven't explored the world behind those things. As a human, the only thing that fascinated me is nature, which I have got to embrace from the early days. The beauty and the freshness and the built-up adrenaline within me whenever I get to have a sight on nature, make me ");
                WriteLiteral(@"proud; proud to the extent that I cry sometimes..actually most of the time. The culture of humans that we have been brought up has let us down; seriously. The culture to embrace the mother nature has been in shadow ever since the culture to achieve, envy and hurdle for so-called success that we might not get happy when we actually get it. So why wait..explore the world. Money counts but that does not mean you have to sacrifice your motive of life for that paper.
